var huHU={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Lehetővé teszi","Allow in your wallet":"Engedd be a pénztárcádba","Allow {symbol} first":["Először engedélyezze a ",["symbol"]," -t"],"Allowance pending":"A juttatás függőben van","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Hiba történt a csere végrehajtása során. Lehet, hogy növelnie kell a csúszási toleranciát. Ha ez nem működik, akkor összeférhetetlenség állhat fenn az Ön által forgalmazott tokennel. Megjegyzés: az átviteli és újrabázis tokenek díja nem kompatibilis az Uniswap V3 verzióval.","Approval pending":"Kérelem folyamatban","Approve":"Jóváhagyás","Approve Permit2":"Approve Permit2","Approve in your wallet":"Jóváhagyja a pénztárcájában","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Először hagyja jóvá a ",["symbol"]," -t"],"Auto":"Auto","Auto Router":"Auto Router","Auto Router API":"Auto Router API","Balance:":"Egyenleg:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Bezárás","Confirm in your wallet":"Erősítse meg pénztárcájában","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Pénztárca csatlakoztatása","Connecting…":"Csatlakozás…","Continue":"Continue","Convert {0} to {1}":["Konvertálja ",["0"]," -t ",["1"],"-re"],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Válassza le a pénztárcát","Dismiss":"Elvetés","Enter an amount":"Adjon meg egy összeget","Error fetching trade":"Hiba történt a kereskedés lekérésekor","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"A legjobb ár lekérése…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"A nagy csúszás növeli az ármozgások kockázatát","I don't have a wallet":"Nincs pénztárcám","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Elégtelen ",["0"]," egyenleg"],"Invalid recipient":"Érvénytelen címzett","Max":"Max","Max slippage":"Max csúszás","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Hiányzó függőségek","Network fee":"Hálózati díj","No results found.":"Nincs találat.","No tokens are available on this network. Please switch to another network.":"Ezen a hálózaton nem érhetők el tokenek. Kérjük, váltson másik hálózatra.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Kérjük, adjon meg egy érvényes csúszást %","Powered by the Uniswap protocol":"Az Uniswap protokoll működteti","Price impact":"Árhatás","Price updated":"Ár frissítve","Reload":"Reload","Reload the page":"Töltse be újra az oldalt","Request rejected":"Request rejected","Review swap":"Véleménycsere","Search by token name or address":"Keresés token név vagy cím alapján","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Valami elromlott","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Siker","Swap":"Swap","Swap failed: {0}":["A csere nem sikerült: ",["0"]],"Switch network":"Hálózat váltása","Switch network in your wallet":"Váltson hálózatot a pénztárcájában","Switching network":"Hálózat váltása","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"A Uniswap invariáns x*y=k nem teljesült a swap során. Ez általában azt jelenti, hogy a cserélendő tokenek egyike egyéni viselkedést tartalmaz az átadáskor.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Az input token nem transzferálható. Probléma lehet az input tokennel.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Az output token nem transzferálható. Probléma lehet az output tokennel.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"A kimeneti token nem vihető át. Probléma lehet a kimeneti tokennel. Megjegyzés: az átviteli és újrabázis tokenek díja nem kompatibilis az Uniswap V3 verzióval.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Ez a tranzakció az ármozgás miatt nem fog sikerülni. Próbáld meg növelni a csúszástűrést. Megjegyzés: az átviteli és újrabázis tokenek díja nem kompatibilis az Uniswap V3 verzióval.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Ez a tranzakció sem az ármozgás, sem az átutalási díj miatt nem lesz sikeres. Próbáld meg növelni a csúszástűrést.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Tranzakció határideje","Transaction rejected":"Tranzakció elutasítva","Transaction submitted":"Tranzakció elküldve","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Próbálja meg növelni a csúszástűrő képességét.<0/>MEGJEGYZÉS: Az átviteli díj és az újraalapozási tokenek nem kompatibilisek az Uniswap V3-mal.","Unexpected error. Could not estimate gas for the swap.":"Váratlan hiba. Nem sikerült megbecsülni a cseréhez szükséges gázt.","Unexpected issue with estimating the gas. Please try again.":"Váratlan probléma a gáz becslésével. Kérlek próbáld újra.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Nézd meg az Etherscan webhelyen","Wallet disconnected":"Wallet disconnected","Warning":"Figyelem","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"A tranzakció visszaáll, ha az ennél hosszabb ideig függőben van.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"A tranzakciója visszaáll, ha az ár ennél a százaléknál nagyobb mértékben változik kedvezőtlenül.","minutes":"perc","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," díj"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

